window.bookSummaryJSON = "<p><b>From the </b><b><i>Wall Street Journal</i></b><b> best-selling co-author of the Tier One series comes a pause-resisting sci-fi thriller about the ultimate battlefield: the human mind. </b></p> <p>Deep in the Afghan mountains, Sergeant Michael Pitcher discovers an object with powers that defy explanation. After interacting with it, he suffers a traumatic seizure and is flown home for evaluation.</p> <p>Cleared by the doctors, Michael goes home to his relieved wife, Josie. But he’s a changed man. The once-loving husband is now coldly withdrawn. After emptying the couple’s bank account, he disappears into the night.</p> <p>When a team of scientists connected to Sergeant Pitcher vanishes without a trace, CIA agent Dean Ninemeyer comes to him for insight - only to find that the recovering soldier has also disappeared.</p> <p>Dean and Josie must now join forces in a desperate race against time, searching for answers in an ever-twisting mystery. What they uncover is a chilling conspiracy that already has the fate of the world in its grip.</p>"; 
